import React from "react";

const FormCart = () => {
  // Đây là nơi để xử lý logic của trang formcart nếu cần

  return (
    <div className="container">
      <h2>Thông tin đặt hàng</h2>
      {/* Đây là nơi để hiển thị thông tin đặt hàng hoặc các trường nhập liệu */}

      {/* Ví dụ về một form đơn giản */}
      <form>
        <div className="form-group">
          <label htmlFor="name">Họ và tên:</label>
          <input type="text" id="name" name="name" className="form-control" />
        </div>
        <div className="form-group">
          <label htmlFor="address">Địa chỉ giao hàng:</label>
          <textarea id="address" name="address" className="form-control" />
        </div>
        <button type="submit" className="btn btn-primary">
          Đặt hàng
        </button>
      </form>
    </div>
  );
};

export default FormCart;
